import React from "react";

import CatalougUpperpart from "../catalaug-3-product/CatalougUpperpart";
import FourPLowerpart from "./FourPLowerpart";


function FourProducts(){
    return(
        <>
        <div className="catalaug">

          <CatalougUpperpart></CatalougUpperpart>

          <FourPLowerpart


                product_1_image ={props.product_1_image}
                product_1_name={props.product_1_name}
                product_1_price ={props.product_1_price}

                product_2_image ={props.product_2_image}
                product_2_name={props.product_2_name}
                product_2_price ={props.product_2_price}

                product_3_image ={props.product_3_image}
                product_3_name={props.product_3_name}
                product_3_price ={props.product_3_price} 

                product_3_image ={props.product_3_image}
                product_3_name={props.product_3_name}
                product_3_price ={props.product_3_price}

          />          

        </div>
        
         </>
    );

}

export default FourProducts;
